スタンダードなチェーンです。雪や氷をガッチリキャッチ！ <br> ミニバン対応 <br><br>今までの金属チェーンより2～3倍長持ちで経済的です！<br><br>スキーやスノボー積雪地域や急な雪に最適です。<br> <br><br>●適合タイヤサイズ（夏・スタッドレスタイヤ共通）<br>145/80R12<br>135/80R13<br>155/70R12<br>155/65R13（夏タイヤのみ）<br>165/60R13（夏タイヤのみ）<br>155/55R14（夏タイヤのみ） <br><br>※必ず駆動輪に取り付けて下さい。FF車（前輪駆動車）は前輪へ、FR車（後輪駆動車）は後輪へ取り付けて下さい。4WD車は車両の取扱い説明書にしたがってください。<br><br>※オフロードタイヤ、4x4タイヤ、LT（ライトトラック）用タイヤには装着できません。<br><br>★近年のスタッドレスタイヤはタイヤ外径・トレッド幅が大きくなる傾向にありますので、一部の銘柄のスタッドレスタイヤへの装着が難しい場合があります。<style type="text/css">
