ミニバン対応！簡単装着チェーンヘルパー付き！<br>ラダー型金属タイヤチェーンです。<br><br><br>雪や氷をガッチリキャッチ！ <br>今までの金属チェーンより2～3倍長持ちで経済的です！<br><br><br>■適合タイヤサイズ<br>175/80R16（夏タイヤのみ）<br>205/70R14<br>195/70R15<br>215/65R14<br>205/65R15<br>205/60R15<br>215/60R15<br>215/55R15<br>205/55R16<br>205/50R17<br>215/45R17<br><br>*必ず駆動輪に取り付けて下さい。FF車（前輪駆動車）は前輪へ、FR車（後輪駆動車）は後輪へ取り付けて下さい。4WD車は車両の取扱い説明書にしたがってください。<br>*オフロードタイヤ、4x4タイヤ、LT（ライトトラック）用タイヤには装着できません。<br><br>■商品内容<br>チェーン本体：1ペア（タイヤ2本分）<br>取扱説明書<br>サイドハンド：2本<br>チェーンヘルパー：1個<br>作業手袋：1ペア<br>補修パーツ：1セット<br><br>■品番：SR-90<br><br>★近年のスタッドレスタイヤはタイヤ外径・トレッド幅が大きくなる傾向にありますので、一部の銘柄のスタッドレスタイヤへの装着が難しい場合があります。<style type="text/css">
